import "./Editor.css";
import OptionItem from "./OptionItem";
import { getItemImgById, selectionList } from "../util";
import { useCallback, useEffect, useState } from "react";
import star from "../img/icon/star.png";
import star_border from "../img/icon/star-border.png";
import Modal from "react-modal";
import Search from "./Search";

const Editor = ({initData, onSubmit}) => {  
    const slicedList = selectionList.slice(1,6);
    const [state, setState] = useState({
        name: "",
        image: "",
        score: 0,
    });
    const {name, image, score} = state;
    const [search, setSearch] = useState();    
    const [modalIsOpen, setModalIsOpen] = useState(false);

    const handleOnSubmit = () => {
        onSubmit(state);
    }
    const handleChangeItemName = (e) => {
        setSearch(e.target.value)
    }
    const handleSearch = () => {
        setState({
            name: search,
        })
    }
    const handleChangeSelection = useCallback((score) => {
        setState((state) => ({
            ...state,
            score,
        }));
    }, []);

    useEffect(() => {
        if(initData){
            setState({
                ...initData
            })
        }
    }, [initData])

    const modalStyle = {
        content: {
            width: "350px",
            height: "600px",
            margin: "auto",
            border: "none",
            borderRadius: "30px", 
            boxShadow: "0 0 5px 2px rgba(0, 0, 0, 0.1)",
        }
    }
    
    return (
        <div className="Editor">
            <div className="editor_container">
                <div>
                    {name ? "" : 
                        <input
                            onChange={handleChangeItemName}
                        />
                    }
                    {name ? "" : <button className="btn_search" onClick={handleSearch}>찾기</button>}
                </div>
                <div className="text_wrapper"> 
                    <h2>{name? `${name}'은(는) 어느 정도 맵나요?` : "음식을 선택해 주세요"}</h2>
                <div className="difficulty_score">
                    난이도 :
                    {score>1 ? <img alt="★" src={star}/> : <img alt="☆" src={star_border}/> }
                    {score>2 ? <img alt="★" src={star}/> : <img alt="☆" src={star_border}/> }
                    {score>3 ? <img alt="★" src={star}/> : <img alt="☆" src={star_border}/> }
                    {score>4 ? <img alt="★" src={star}/> : <img alt="☆" src={star_border}/> }
                    {score>5 ? <img alt="★" src={star}/> : <img alt="☆" src={star_border}/> }  
                </div>
                </div>
                <div className="selection_list_wrapper">
                    {slicedList.map((it) => (
                        <OptionItem
                            key={it.id}
                            {...it}
                            isTest={false}
                            onClick={handleChangeSelection}
                            isSelected={score === it.id}
                        />
                    ))}
                </div>
                <button className="btn_submit" onClick={handleOnSubmit}>작성하기</button>
            </div>
            <div className="image_wrapper">
                <img alt="" src={image ? image : getItemImgById(0)} onClick={() => {setModalIsOpen(true)}}/> 
                <Modal style={modalStyle} ariaHideApp={false} isOpen={modalIsOpen} onRequestClose={()=>{setModalIsOpen(false)}}>    
                        <Search isFood={true}/>
                </Modal>
                <div>
                    {name ? <h2>{name}</h2> : ""}
                </div>
            </div>
        </div>
    );
}

export default Editor;
